	<script type='text/javascript' src="util/jivosite.js"></script>
	
	<script>
		var distance;
		var selected_time = null;
		$(function() {
			var start = moment();
			$('input[name="daterange"]').daterangepicker({
				singleDatePicker: true,
				startDate: start,
				drops: "up",
				locale: {
					"cancelLabel": "Закрыть",
					"applyLabel": "Применить",
					"weekLabel": "Неделя",
					"daysOfWeek": [
						"Вс",
						"Пн",
						"Вт",
						"Ср",
						"Чт",
						"Пт",
						"Сб"
					],
					"firstDay": 1,
					"monthNames": [
						"Январь",
						"Февраль",
						"Март",
						"Апрель",
						"Май",
						"Июнь",
						"Июль",
						"Август",
						"Сентябрь",
						"Октябрь",
						"Ноябрь",
						"Декабрь"
					]
				}
			}, function(start, label) {
				selected_time = start / 1000;
			});
		});
	
		$("#name").bind('input', function() {
			updateNextVisibility();
		});	
		$("#address_from").bind('input', function() {
			updateNextVisibility();
		});	
		$("#address_to").bind('input', function() {	
			updateNextVisibility();
		});
		$("#full_name").bind('input', function() {	
			updateNextVisibility();
		});
		$("#email").bind('input', function() {	
			updateNextVisibility();
		});
		$("#password").bind('input', function() {	
			updateNextVisibility();
		});
		$("#phone").bind('input', function() {	
			updateNextVisibility();
		});
		$('#address_from').keyup(function() {
			delay(function(){
				calcRoute();
			}, 1000 );
		});
		$('#address_to').keyup(function() {
			delay(function(){
				calcRoute();
			}, 1000 );
		});
		var delay = (function(){
			var timer = 0;
			return function(callback, ms){
				clearTimeout (timer);
				timer = setTimeout(callback, ms);
			};
		})();
		
		function updateNextVisibility(){
			if (currentStep == 1){
				if ($("#name").val().length == 0){
					$("#next_step").attr("disabled", "");
				} else {
					$("#next_step").removeAttr("disabled");
				}
			} else if (currentStep == 2){
				if ($("#address_from").val().length == 0 || $("#address_to").val().length == 0){
					$("#next_step").attr("disabled", "");
				} else {
					$("#next_step").removeAttr("disabled");
				}
			} else {
				if ((!$("#registerCheckbox").is(':checked') && ($("#full_name").val().length > 0 && $("#email").val().length > 0 && $("#phone").val().length > 0))
					|| ($("#registerCheckbox").is(':checked') && ($("#email").val().length > 0 && $("#password").val().length > 0))){
					$("#next_step").removeAttr("disabled");
				} else {
					$("#next_step").attr("disabled", "");
				}
			}
		}
		
		var currentStep = 1;
		function updatePreviousVisibility(){
			if (currentStep == 1){
				$("#previous_step").attr("disabled", "");
			} else {
				$("#previous_step").removeAttr("disabled");			
			}
		}
		
		$("#previous_step").click(function() {
			if (currentStep == 2){
				showStep1();
			} else {
				showStep2();
			}
		});
		$("#next_step").click(function() {
			if (currentStep == 1){
				showStep2();
			} else if (currentStep == 2){
				showStep3();
			} else {
				submitFreight();
			}
		});
		
		function showStep1(){
			currentStep = 1;
			
			$("#step1").removeClass("Navigation-stage -done");
			$("#step1").addClass("Navigation-stage -active");
			
			$("#step2").removeClass("Navigation-stage -active");
			$("#step2").addClass("Navigation-stage");
			
			$("#step1Layout").show();
			$("#step2Layout").hide();
			$("#step3Layout").hide();
			
			$("#next_step").attr("disabled", "");
			
			updateNextVisibility();
			updatePreviousVisibility();
		}
		
		function showStep2(){
			currentStep = 2;
			
			$("#step1").removeClass("Navigation-stage -active");
			$("#step1").addClass("Navigation-stage -done");
			
			$("#step2").removeClass("Navigation-stage -done");
			$("#step2").addClass("Navigation-stage -active");
			
			$("#step3").removeClass("Navigation-stage -active");
			$("#step3").addClass("Navigation-stage");
			
			$("#step1Layout").hide();
			$("#step2Layout").show();
			$("#step3Layout").hide();
			
			$("#next_step").addClass("ButtonControl-sky");
			$("#next_step").removeClass("ButtonControl-sand ContactsScreen-controls-next");
			$("#next_step").html("Следующий шаг");
			
			updateNextVisibility();
			updatePreviousVisibility();
		}
		
		function showStep3(){
			currentStep = 3;
			
			$("#step2").removeClass("Navigation-stage -active");
			$("#step2").addClass("Navigation-stage -done");
			
			$("#step3").addClass("-active");
			
			$("#step1Layout").hide();
			$("#step2Layout").hide();
			$("#step3Layout").show();
			
			$("#next_step").removeClass("ButtonControl-sky");
			$("#next_step").addClass("ButtonControl-sand ContactsScreen-controls-next");
			$("#next_step").html("Узнать стоимость перевозки");
			
			updateNextVisibility();
			updatePreviousVisibility();
		}
		
		function submitFreight(){			
			var title = $("#name").val();		
			var price = $("#price").val();	
			var weight = $("#weight").val();
			var volume = $("#volume").val();
			var description = $("#description").val();
			var address_from = $("#address_from").val();
			var address_to = $("#address_to").val();
			
			var full_name = $("#full_name").val();
			var email = $("#email").val();
			var phone = $("#phone").val();
			var password = $("#password").val();
			
			var registered = $("#registerCheckbox").is(':checked');
			
			var time = null;
			if ($("#dateCheckbox").is(':checked')){
				// Check if user selected a new date
				if (selected_time != null){
					time = selected_time;
				} else {
					// Use today's date
					time = Math.floor(Date.now() / 1000);
				}
			}
			
			$.ajax({
				type: "POST",
				url: '../api/freight/add_freight',
				data: {
					"user_id": "<?php echo $session_user_id ?>",
					"title": title,
					"price": price,
					"weight": weight,
					"volume": volume,
					"description": description,
					"address_from": address_from,
					"address_to": address_to,
					"distance": distance,
					"full_name": full_name,
					"email": email,
					"phone": phone,
					"password": password,
					"time": time,
					"registered": registered,
				},
				dataType: "json",
				success: function(data){
					if ('error' in data){
						alert(data["error"]);
					} else {						
						window.open ('zaprosy.php', '_self', false);
					}
				},
				error: function(data){
					alert(JSON.stringify(data));
				}
			});
		}
		
		$("#dateCheckbox").click(function() {
			if ($(this).is(':checked')) {
				$("#dateLayout").show();
			} else {
				$("#dateLayout").hide();
			}
		});
		
		$("#registerCheckbox").click(function() {
			if ($(this).is(':checked')) {
				$("#nameLayout").hide();
				$("#contactsTipLayout").hide();
				$("#phoneLayout").hide();
				$("#passwordLayout").show();
			} else {
				$("#nameLayout").show();
				$("#contactsTipLayout").show();
				$("#phoneLayout").show();
				$("#passwordLayout").hide();
			}
			updateNextVisibility();
		});
		
		var directionsService;
			
		function initAutocomplete() {
			var input_from = document.getElementById('address_from');
			var autocomplete_from = new google.maps.places.Autocomplete(input_from);
			var input_to = document.getElementById('address_to');
			var autocomplete_to = new google.maps.places.Autocomplete(input_to);
			google.maps.event.addListener(autocomplete_from, 'place_changed', function() {
				result = autocomplete_from.getPlace();
				if(typeof result.address_components !== 'undefined') {
					calcRoute();
				}
			});
			google.maps.event.addListener(autocomplete_to, 'place_changed', function() {
				result = autocomplete_to.getPlace();
				if (typeof result.address_components !== 'undefined') {
					calcRoute();
				}
			});
			
			directionsService = new google.maps.DirectionsService()
		}
			
		function calcRoute() {			
			var address_from = $("#address_from").val();
			var address_to = $("#address_to").val();
			
			if (address_from=="" || address_to==null) return;
		
			var request = {
				// from: Blackpool to: Preston to: Blackburn
				origin: address_from,
				destination: address_to,
				optimizeWaypoints: true,
				travelMode: google.maps.DirectionsTravelMode.DRIVING
			};
			directionsService.route(request, function(response, status) {
				if (status == google.maps.DirectionsStatus.OK) {
					computeTotalDistance(response);
				}
			});
		}
			
		function computeTotalDistance(result) {
			var totalDist = 0;
			var totalTime = 0;
			var myroute = result.routes[0];
			for (i = 0; i < myroute.legs.length; i++) {
				totalDist += myroute.legs[i].distance.value;
				totalTime += myroute.legs[i].duration.value;
			}
			totalDist = totalDist / 1000.
			distance = Math.round(totalDist);
		}
	</script>
	<script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyBL5UB6urkL0ni5h-_R9WqLBIJxWdgZl2w&libraries=places&callback=initAutocomplete&language=ru&region=ua" async defer></script>
